import React from "react";

export default (props) => {
    return (
        <tbody>
        {props.rows.map((item, index) => {
            return (
                <tr>
                    <td>{item.fio}</td>
                    <td>{item.position}</td>
                    <td>{item.tabNumber}</td>
                </tr>
            )}
        )}
        </tbody>
    )
}
